import React from 'react'
const ItemsList = ({items, setItems}) => {
    return (
        <div>
            {items.map((item) => (
                <li className="list-item" key={item.id}>
                    <input 
                    type="text"
                     value={item.title} 
                     className="list" 
                     onChange={(event) => event.preventDefault()} />
                     <div></div>


                </li>

            )

            )}
        </div>
    )
}
export default ItemsList;
